import React, { useState, useEffect } from 'react';

const ProgressBar = ({ currentStep, totalSteps }) => {
    const [progress, setProgress] = useState(0);

    // Mise à jour de la progression lorsque currentStep ou totalSteps change
    useEffect(() => {
        if (!isNaN(currentStep) && !isNaN(totalSteps) && totalSteps !== 0) {
            const newProgress = (currentStep / totalSteps) * 100;
            setProgress(newProgress);
        }
    }, [currentStep, totalSteps]);

    // Vérification si currentStep et totalSteps sont définis
    if (isNaN(currentStep) || isNaN(totalSteps) || totalSteps === 0) {
        console.warn('currentStep or totalSteps is NaN or totalSteps is 0:', currentStep, totalSteps);
        return null; // Retourne null si les valeurs ne sont pas définies ou sont NaN
    }

    return (
        <div className="flex flex-col items-center border border-gray-300 rounded-lg p-4 shadow-md mt-4">
            {/* Barre de progression avec cadre */}
            <div className="relative w-full h-6 bg-gray-200 rounded-full overflow-hidden">
                <div className="absolute top-0 left-0 h-full bg-blue-500 rounded-full" style={{ width: `${progress}%` }}></div>
            </div>
            {/* Noms des étapes dans la barre */}
            <div className="flex justify-between w-full mt-2 text-xs text-gray-600">
                <div className="w-1/5 text-center relative">
                    <div className="absolute -top-6 left-1/2 transform -translate-x-1/2 h-2 w-28 bg-gray-100 rounded-lg flex justify-center items-center">
                        <div className={`py-1 px-2 bg-white rounded-lg ${currentStep >= 1 ? 'text-blue-500 font-bold' : 'text-gray-500 font-light'}`}>
                            General Information
                        </div>
                    </div>
                </div>
                <div className="w-1/5 text-center relative">
                    <div className="absolute -top-6 left-1/2 transform -translate-x-1/2 h-2 w-28 bg-gray-100 rounded-lg flex justify-center items-center">
                        <div className={`py-1 px-2 bg-white rounded-lg ${currentStep >= 2 ? 'text-green-500 font-bold' : 'text-gray-500 font-light'}`}>
                            Supply Chain Due Diligence
                        </div>
                    </div>
                </div>
                <div className="w-1/5 text-center relative">
                    <div className="absolute -top-6 left-1/2 transform -translate-x-1/2 h-2 w-28 bg-gray-100 rounded-lg flex justify-center items-center">
                        <div className={`py-1 px-2 bg-white rounded-lg ${currentStep >= 3 ? 'text-yellow-500 font-bold' : 'text-gray-500 font-light'}`}>
                            Design of Circularity
                        </div>
                    </div>
                </div>
                <div className="w-1/5 text-center relative">
                    <div className="absolute -top-6 left-1/2 transform -translate-x-1/2 h-2 w-28 bg-gray-100 rounded-lg flex justify-center items-center">
                        <div className={`py-1 px-2 bg-white rounded-lg ${currentStep >= 4 ? 'text-pink-500 font-bold' : 'text-gray-500 font-light'}`}>
                            Battery Materials and Composition
                        </div>
                    </div>
                </div>
                <div className="w-1/5 text-center relative">
                    <div className="absolute -top-6 left-1/2 transform -translate-x-1/2 h-2 w-28 bg-gray-100 rounded-lg flex justify-center items-center">
                        <div className={`py-1 px-2 bg-white rounded-lg ${currentStep >= 5 ? 'text-purple-500 font-bold' : 'text-gray-500 font-light'}`}>
                            Performance and Durability
                        </div>
                    </div>
                </div>
            </div>
            {/* Traits arrondis */}
            <div className="flex justify-between mt-1">
                <div className={`w-1/5 h-1 bg-gray-300 rounded-full ${currentStep >= 1 ? 'bg-blue-500' : ''}`}></div>
                <div className={`w-1/5 h-1 bg-gray-300 rounded-full ${currentStep >= 2 ? 'bg-green-500' : ''}`}></div>
                <div className={`w-1/5 h-1 bg-gray-300 rounded-full ${currentStep >= 3 ? 'bg-yellow-500' : ''}`}></div>
                <div className={`w-1/5 h-1 bg-gray-300 rounded-full ${currentStep >= 4 ? 'bg-pink-500' : ''}`}></div>
                <div className={`w-1/5 h-1 bg-gray-300 rounded-full ${currentStep >= 5 ? 'bg-purple-500' : ''}`}></div>
            </div>
        </div>
    );
};

export default ProgressBar;
